import React from 'react';
import { Link } from 'react-router-dom';

function Profile() {
  const profileBadges = [
    { name: 'Code Master', icon: 'üíª', color: '#FFD700', earned: true },
    { name: 'AI Explorer', icon: 'ü§ñ', color: '#8A2BE2', earned: true },
    { name: 'Team Player', icon: 'üë•', color: '#00FF00', earned: false },
    { name: 'Quick Learner', icon: '‚ö°', color: '#00BFFF', earned: true }
  ];

  return (
    <div style={{
      minHeight: '100vh',
      background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
      padding: '2rem',
      color: 'white'
    }}>
      <div style={{
        maxWidth: '1200px',
        margin: '0 auto'
      }}>
        {/* Profile Header */}
        <div style={{
          background: 'rgba(255, 255, 255, 0.1)',
          backdropFilter: 'blur(10px)',
          border: '1px solid rgba(255, 255, 255, 0.2)',
          borderRadius: '20px',
          padding: '2rem',
          marginBottom: '2rem',
          textAlign: 'center'
        }}>
          <div style={{
            width: '120px',
            height: '120px',
            borderRadius: '50%',
            background: 'linear-gradient(45deg, #ff6b6b, #feca57)',
            margin: '0 auto 1rem',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            fontSize: '3rem',
            boxShadow: '0 10px 30px rgba(0,0,0,0.3)'
          }}>
            üë®‚Äçüíª
          </div>
          <h1 style={{ fontSize: '2.5rem', marginBottom: '0.5rem' }}>Arjun Sharma</h1>
          <p style={{ opacity: 0.8, fontSize: '1.1rem', marginBottom: '1rem' }}>
            Computer Science Student | Full Stack Developer
          </p>
          <div style={{
            display: 'flex',
            justifyContent: 'center',
            gap: '2rem',
            flexWrap: 'wrap'
          }}>
            <div style={{ textAlign: 'center' }}>
              <div style={{ fontSize: '1.5rem', fontWeight: 'bold', color: '#feca57' }}>2,847</div>
              <div style={{ fontSize: '0.9rem', opacity: 0.8 }}>Profile Views</div>
            </div>
            <div style={{ textAlign: 'center' }}>
              <div style={{ fontSize: '1.5rem', fontWeight: 'bold', color: '#feca57' }}>12</div>
              <div style={{ fontSize: '0.9rem', opacity: 0.8 }}>Achievements</div>
            </div>
            <div style={{ textAlign: 'center' }}>
              <div style={{ fontSize: '1.5rem', fontWeight: 'bold', color: '#feca57' }}>Level 8</div>
              <div style={{ fontSize: '0.9rem', opacity: 0.8 }}>Current Level</div>
            </div>
          </div>
        </div>

        <div style={{
          display: 'grid',
          gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))',
          gap: '2rem'
        }}>
          {/* Personal Information */}
          <div style={{
